// Complete the countTriplets function below.
function countTriplets(arr, r) {
  // the key-value pair, will be key-frequence
  function addToMap(map, key, count) {
    let value = map.has(key) ? count + map.get(key) : count;
    map.set(key, value);
  }

  let count = 0;
  let b1 = new Map(),
    b2 = new Map();
  for (let key of arr) {
    let division = key / r;
    if (b2.has(division)) {
      count += b2.get(division);
    }
    if (b1.has(division)) {
      addToMap(b2, key, b1.get(division));
    }
    addToMap(b1, key, 1);
  }

  return count;
}

